import '../css/index.css';


function Tag(type) {
    let name = '';
    let className = '';

    switch (type) {
        case 'vb':
            name = "Visual Basic";
            className = "tag-vb";
            break;
        case 'react':
            name = "React";
            className = "tag-react";
            break;
        default:
            name = '';
            className = '';
            break;
      }


  return (
    <span className={className}>{name}</span>
  );
}

export default Tag;
